import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import RegisterUserPage from "./pages/user/UserPage";

import MoviePage from "./pages/movie/Page/PageMovie";
import CreateMoviePage from "./pages/movie/CreatePage/CreatePageMovie";
import DetailMoviePage from "./pages/movie/DetailPage/DetailPageMovie";

import ReviewPage from "./pages/review/Page/PageReview";
import CreateReviewPage from "./pages/review/CreatePage/CreatePageReview";
import DetailReviewPage from "./pages/review/DetailPage/DetailPageReview";
import { UserProvider } from './context/UserContext';

function App() {
  return (
    <div className="App">
      <UserProvider>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<RegisterUserPage />} />

            {/* Movie routes */}
            <Route path="/movies" element={<MoviePage />} />
            <Route path="/movies/addMovie" element={<CreateMoviePage />} />
            <Route path="/movies/detailMovie/:idMovie" element={<DetailMoviePage />} />

            {/* Review routes */}
            <Route path="/reviews/:idMovie" element={<ReviewPage />} />
            <Route path="/reviews/addReview/:idMovie" element={<CreateReviewPage />} />
            <Route path="/reviews/detailReview/:idReview" element={<DetailReviewPage />} />
          </Routes>
        </BrowserRouter>
      </UserProvider>
    </div>
  );
}

export default App;
